        "description": "Светящиеся насадки на пальцы  - это новый необычный и увлекательный светящийся аксессуар, популярный у детей и взрослых на праздниках, дискотеках, концертах и среди всех любителей необычных ночных съемок. Каждый лазер –  это кольцо со встроенным ярким светодиодом в виде меча. Лазерные пальцы можно надеть на основание пальца и включить подсветку, тогда в темноте будет эффект длинных светящихся пальцев. При быстром движении рук  в темноте появляются яркие линии и картинки, можно делать необычные фотографии. В каждой насадке есть перекючатель, чтобы включать и выключать светодиод. В комплекте: 3 насадки на пальцы разных цветов (красный, синий, зеленый).",
