        "description": "Светящиеся насадки на пальцы  - это новый необычный и увлекательный светящийся аксессуар, популярный у детей и взрослых на праздниках, дискотеках, концертах и среди всех любителей необычных ночных съемок. Каждый лазер –  это пластиковый короб со встроенным ярким светодиодом, оснащенный резинкой, чтобы одевать на палец. Лазерные пальцы можно надеть на основание пальца и включить подсветку, тогда в темноте будет эффект длинных светящихся пальцев. При быстром движении рук с \"Лазерными пальцами\" в темноте появляются яркие линии и картинки, можно делать необычные фотографии. В каждой насадке есть перекючатель, чтобы включать и выключать светодиод. В комплекте: 4 насадки на пальцы разных цветов (красный, белый, синий, зеленый).",
