        "description": "Воздушный шар из натурального латекса белого цвета. Тип шара - стандарт. Это значит, что цвет шара матовый. Шар Everts идеально подходит для использования в оформлении. Благодаря круглой, гармоничной форме отлично смотрится в букетах. Эластичный хвостик шара делает работу с ним удобной и приятной. Отлично держит гелий благодаря плотной структуре латекса. Шар создан по немецким технологиям в Малайзии. Шары Everts соответствуют самым высоким и строгим европейским стандартам качества. Безопасность шара для детей гарантируют сертификаты Евросоюза EN71 Toy Safety Directive и TÜV Product Safety GmbH. Шары Everts полностью биоразлагаемы и безвредны для экологии.",
