        "description": "Высококачественный шар из натурального латекса. Ассорти из нескольких цветов в случайном соотношении), одного типа - пастель - матовый оттенок цвета. Шары счетырехсторонним - круговая печать, шелкографическим рисунком на тему мультфильма Смешарики Нюша. Предназначен для розничной продажи воздушных шариков. Идеальный ассортимент для праздничных оформлений. Воздушные шары изготавливаются из экологически безопасного 100%-ного натурального латекса. В окружающей среде разлагаются на безопасные компоненты примерно с той-же скоростью, как обычные листья деревьев. После использования лопнуть и утилизировать как бытовой отход.",
